// src/pages/History.js
import React from 'react';

const History = () => {
  return (
    <div className="container mx-auto my-5 text-center">
      <h1 className="text-2xl font-bold">History Page</h1>
      <p className="mt-4">View your location history here!</p>
    </div>
  );
};

export default History;
